import Ball from './Ball';

export default function Flask({ball, config}) {
    console.log(config)
    return (
        <div className='flask'>
            <div className='flaskChild' style={{minWidth: 25, minHeight: config.ballCount * 34 }}>
                <div className='flaskAbs'>
                    {ball.map( i=> <Ball key={i} num={i}/>)}
                </div>
            </div>
        </div>
    );
}
